import { useState, useEffect } from "react";

export default function HomePageView() {
  const [meme, setMeme] = useState({});

  useEffect(() => {
    fetch("https://www.reddit.com/r/memes.json")
      .then((res) => res.json())
      .then((body) => {
        console.log(body);
        setMeme(body)
      });
  }, []);
  return (
    <div className="container">
      <h1>Homepage</h1>
    </div>
  );
}
